import React from 'react';
import Navbar from '../Navbar';
import Footer from '../Footer';
import { MDBCol, MDBRow } from 'mdb-react-ui-kit';
import Header from '..pages/components';

export default function Home() {
    return (
        <>
            <Navbar />
            <div className='bg-dark text-white p-5'>
                <MDBRow className='m-5 p-5'>
                    <MDBCol size='6'>
                        <p>HEY, THIS IS ME</p>
                        <h1 className='display-2'><b>Huzaifa Ahmed</b></h1>
                        <p>"Welcome to my world of web development wonders! As a full-stack web developer, I bring ideas to life through elegant code and captivating design. Let's create extraordinary digital experiences together!"</p>
                        <a className="btn btn-warning px-4" href="/" role="button">DISCOVER ME</a>
                        <a className="btn btn-outline-warning px-4 ms-4" href="/" role="button" target="_blank">HIRE ME</a>
                    </MDBCol>
                    <MDBCol size='6'>
                        <img src={Header} alt="logo" height='100' className='ms-5' />
                    </MDBCol>
                </MDBRow>
            </div>
            <Footer />
        </>
    )
}
